    "## In summary\n",
    "- Any periodic signal can be constructed from a sum of sine waves.\n",
    "  - The process of creating complex sounds from sine waves or other constituent parts is called additive synthesis.\n",
    "- The sine wave, sawtooth wave, triangle wave, and pulse waves are classic waveforms since the advent of electronic music.\n",
    "  - They are used everywhere in the music we hear today and we are the basis od many synthesizers.\n",
    "- Sawtooth waves, triangle waves, and pulse waves come in badlimited and non-bandlimited forms.\n",
    "  - Non-bandlimiteds forms can be produce strange artifacts at higher frequencies (see aliasing coming up).\n",
    "  - Bandlimited forms are \"safer\" but are not as rich harmonically - they are not true representing of the waveforms.\n"
